import React, {useState, useEffect} from "react";

function App() {
  const [data, setData] = useState("");

  useEffect(() => {
    fetch('/api')
    .then(res => res.json())
    .then(res => setData(res.table))
  }, []);

  !data ? console.log("Loading...") : data.forEach(el => { console.log(el); })

  return (
    <div className="container">
      <table className="table">
        <thead>
          <tr>
            <th>Номер</th>
            <th>Дата</th>
            <th>Имя</th>
            <th>Количество</th>
            <th>Дистанция</th>
          </tr>
        </thead>
        <tbody>
          {
            [...data].map(
              item => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.date.slice(0, 10)}</td>
                  <td>{item.name}</td>
                  <td>{item.count}</td>
                  <td>{item.distance}</td>
                </tr>
              )
            )
          }
        </tbody>
      </table>
    </div>
  );
}

export default App;
